  false,\n\t\"url\": null,\n\t\"notes\": \"This data set comprises the Environmental
  Sensitivity Index (ESI) data for Western Alaska. ESI data characterize estuarine
  environments and wildlife by their sensitivity to spilled oil. The ESI data include
  information for three main components: shoreline habitats, sensitive biological
  resources, and human-use resources. This data set contains hydrology data.nnThe
  ESI data were collected, mapped, and digitized to provide environmental data for
  oil spill planning and response. The Clean Water Act with amendments by the Oil
  Pollution Act of 1990 requires response plans for immediate and effective protection
  of sensitive resources.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
